-- ----------------------------
-- Table structure for itboye_orders
-- ----------------------------
DROP TABLE IF EXISTS `itboye_orders`;
CREATE TABLE `itboye_orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL COMMENT '下单用户id',
  `order_code` char(64) NOT NULL COMMENT '精确到秒，毫秒',
  `price` int(11) NOT NULL COMMENT '最终商品总价,不包含运费,不算优惠,分',
  `post_price` int(11) NOT NULL DEFAULT '0' COMMENT '该订单运费,分',
  `note` varchar(256) NOT NULL COMMENT '备注',
  `status` tinyint(2) NOT NULL COMMENT '数据状态,-1 已删除 0：已禁用 1：正常 2：待审核',
  `pay_status` tinyint(2) NOT NULL COMMENT '支付状态（0:未付款 1：已付款  2：已退款）',
  `order_status` tinyint(2) NOT NULL COMMENT '订单状态（2待确认，3待发货，4已发货，5已收货，6已退货，7已完成，8取消或交易关闭，12订单退回）',
  `cs_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '售后状态(0: 初始状态 2 待处理 3 已处理)',
  `createtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updatetime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `comment_status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0：待评价 1：手动评价 2：自动评价',
  `from` int(11) NOT NULL DEFAULT '1' COMMENT '来源:1、PC,2、Android,3、IOS',
  `discount_money` int(11) NOT NULL DEFAULT '0' COMMENT '优惠金额(该订单包含商品的总计)',
  `storeid` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `goods_amount` int(11) NOT NULL DEFAULT '0' COMMENT '货款',
  `pay_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付类型(1: 支付宝)',
  `pay_code` char(48) NOT NULL DEFAULT '' COMMENT '交易号',
  `pay_balance` int(11) NOT NULL DEFAULT '0' COMMENT '支付的余额,1:1',
  `score_pay` int(11) NOT NULL DEFAULT '0' COMMENT '积分抵扣的金额,分',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '使用的积分',
  `bill_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '1=>个人,2=>企业',
  `bill_title` varchar(64) NOT NULL DEFAULT '' COMMENT '发票抬头',
  `bill_code` varchar(64) NOT NULL DEFAULT '' COMMENT '企业发票税号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8mb4;

