  `product_code` varchar(32) NOT NULL DEFAULT '' COMMENT '商品编号',
  `secondary_headlines` varchar(512) NOT NULL DEFAULT '' COMMENT '二级标题',
  `template_id` int(11) NOT NULL COMMENT '运费模板ID(0: 免邮 其它模板ID)',
  `loc_country` char(16) NOT NULL COMMENT '所属国家',
  `loc_province` char(32) NOT NULL COMMENT '所属省份',
  `loc_city` char(32) NOT NULL COMMENT '所属城市',
  `loc_address` varchar(128) NOT NULL COMMENT '所属区域',
  `cate_id` char(16) NOT NULL COMMENT '商品分类ID',
  `create_time` int(11) unsigned NOT NULL,
  `update_time` int(11) unsigned NOT NULL,
  `onshelf` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否上架(0:否,1:是)',
