  `cnt2` int(11) NOT NULL DEFAULT '0' COMMENT '区间2最小起批量',
  `price3` int(11) NOT NULL DEFAULT '0' COMMENT '区间3价格(单位:分)',
  `cnt3` int(11) NOT NULL DEFAULT '0' COMMENT '区间3最小起批量',
  `update_time` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

