  `order_code` char(64) NOT NULL COMMENT '精确到秒，毫秒',
  `trade_no` char(64) NOT NULL DEFAULT '' COMMENT '交易号-第三方',
  `pay_code` char(48) NOT NULL DEFAULT '' COMMENT '交易号',
  `money` int(11) NOT NULL COMMENT '总价,所有的,分',
  `note` varchar(256) NOT NULL DEFAULT '' COMMENT '备注',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '数据状态,-1 已删除 0：禁用 1:正常 2:待审核',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `from` int(11) NOT NULL DEFAULT '0' COMMENT '来源:1、PC,2、Android,3、IOS',
  `pay_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付类型(1: 支付宝)',
  `pay_status` tinyint(2) NOT NULL DEFAULT '0' COMMENT '支付状态（0:未付款 1：已付款  2：已退款）',
  `pay_money` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4 COMMENT='余额充值订单';

