-- ----------------------------
-- View structure for v_api_history
-- ----------------------------
DROP VIEW IF EXISTS `v_api_history`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_api_history` AS select `itboye_api_history`.`api_uri` AS `api_uri`,avg(`itboye_api_history`.`request_time`) AS `avg_req_time`,max(`itboye_api_history`.`request_time`) AS `max_req_time`,min(`itboye_api_history`.`request_time`) AS `min_req_time`,count(`itboye_api_history`.`request_time`) AS `api_cnt`,avg(`itboye_api_history`.`cost_time`) AS `avg_cost_time`,max(`itboye_api_history`.`cost_time`) AS `max_cost_time`,min(`itboye_api_history`.`cost_time`) AS `min_cost_time` from `itboye_api_history` group by `itboye_api_history`.`api_uri` order by `avg_req_time` desc ;

-- ----------------------------
-- View structure for v_orders_view
-- ----------------------------
DROP VIEW IF EXISTS `v_orders_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_orders_view` AS SELECT
itboye_orders.pay_code AS pay_code,
itboye_orders.note AS note,
itboye_orders.pay_type AS pay_type,
itboye_orders.goods_amount AS goods_amount,
itboye_orders.id AS id,
itboye_orders.order_code AS order_code,
itboye_orders.post_price AS post_price,
itboye_orders.discount_money AS discount_money,
itboye_orders.createtime AS createtime,
itboye_orders.updatetime AS updatetime,
itboye_orders.uid AS uid,
itboye_orders.price AS price,
itboye_orders.pay_balance AS pay_balance,
itboye_orders.`status` AS `status`,
itboye_orders.storeid AS storeid,
itboye_orders.pay_status AS pay_status,
itboye_orders.order_status AS order_status,
itboye_orders.comment_status AS comment_status,
itboye_orders_contactinfo.wxno AS wxno,
itboye_orders_contactinfo.detailinfo AS detailinfo,
itboye_orders_contactinfo.contactname AS contactname,
itboye_orders_contactinfo.country AS country,
itboye_orders_contactinfo.city AS city,
itboye_orders_contactinfo.province AS province,
itboye_orders_contactinfo.area AS area,
itboye_orders_contactinfo.mobile AS mobile,
itboye_orders_contactinfo.id_card AS id_card,
common_member.nickname AS username,
itboye_store.`name` AS store_name,
itboye_store.`desc` AS store_desc,
itboye_store.banner AS store_banner,
itboye_store.logo AS store_logo,
itboye_store.service_phone AS service_phone,
itboye_orders.score_pay,
itboye_orders.score,
itboye_orders_paycode.true_pay_money,
itboye_orders.bill_type,
itboye_orders.bill_title,
itboye_orders.bill_code
FROM
(((itboye_orders
LEFT JOIN itboye_orders_contactinfo ON ((itboye_orders.order_code = itboye_orders_contactinfo.order_code)))
LEFT JOIN common_member ON ((itboye_orders.uid = common_member.uid)))
LEFT JOIN itboye_store ON ((itboye_orders.storeid = itboye_store.id)))
INNER JOIN itboye_orders_paycode ON itboye_orders.pay_code = itboye_orders_paycode.pay_code ;

-- ----------------------------
-- View structure for v_post_info
-- ----------------------------
DROP VIEW IF EXISTS `v_post_info`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_post_info` AS select `p`.`jump_url` AS `jump_url`,`p`.`start_time` AS `start_time`,`p`.`end_time` AS `end_time`,`m`.`realname` AS `realname`,`m`.`nickname` AS `nickname`,`p`.`id` AS `id`,`p`.`post_author` AS `post_author`,`p`.`post_author_name` AS `post_author_name`,`p`.`post_date` AS `post_date`,`p`.`post_content` AS `post_content`,`p`.`post_view` AS `post_view`,`p`.`post_title` AS `post_title`,`p`.`post_category` AS `post_category`,`p`.`post_excerpt` AS `post_excerpt`,`p`.`post_modified` AS `post_modified`,`p`.`post_status` AS `post_status`,`p`.`comment_status` AS `comment_status`,`p`.`post_type` AS `post_type`,`p`.`main_img` AS `main_img`,`d`.`name` AS `post_cate_name` from ((`itboye_post` `p` left join `common_datatree` `d` on((`d`.`id` = `p`.`post_category`))) left join `common_member` `m` on((`m`.`uid` = `p`.`post_author`))) ;

-- ----------------------------
-- View structure for v_refund_info
-- ----------------------------
DROP VIEW IF EXISTS `v_refund_info`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_refund_info` AS select `itboye_orders`.`pay_code` AS `pay_code`,`itboye_orders`.`pay_type` AS `pay_type`,`itboye_orders`.`goods_amount` AS `goods_amount`,`itboye_orders`.`id` AS `id`,`itboye_orders`.`order_code` AS `order_code`,`itboye_orders`.`post_price` AS `post_price`,`itboye_orders`.`discount_money` AS `discount_money`,`itboye_orders`.`createtime` AS `createtime`,`itboye_orders`.`updatetime` AS `updatetime`,`itboye_orders`.`uid` AS `uid`,`itboye_orders`.`price` AS `price`,`itboye_orders`.`status` AS `status`,`itboye_orders`.`storeid` AS `storeid`,`itboye_orders`.`pay_status` AS `pay_status`,`itboye_orders`.`order_status` AS `order_status`,`itboye_orders`.`cs_status` AS `cs_status`,`itboye_order_refund`.`id` AS `thid`,`itboye_order_refund`.`reason` AS `reason`,`itboye_order_refund`.`valid_status` AS `valid_status`,`itboye_order_refund`.`reply_msg` AS `reply_msg`,`itboye_order_refund`.`create_time` AS `create_time`,`itboye_orders_contactinfo`.`detailinfo` AS `detailinfo`,`itboye_orders_contactinfo`.`contactname` AS `contactname`,`itboye_orders_contactinfo`.`country` AS `country`,`itboye_orders_contactinfo`.`city` AS `city`,`itboye_orders_contactinfo`.`province` AS `province`,`itboye_orders_contactinfo`.`area` AS `area`,`itboye_orders_contactinfo`.`mobile` AS `mobile`,`itboye_orders_contactinfo`.`id_card` AS `id_card`,`common_member`.`nickname` AS `username`,`itboye_store`.`name` AS `store_name`,`itboye_store`.`uid` AS `store_uid`,`itboye_store`.`desc` AS `store_desc`,`itboye_store`.`banner` AS `store_banner`,`itboye_store`.`logo` AS `store_logo`,`itboye_store`.`service_phone` AS `service_phone` from ((((`itboye_orders` left join `itboye_order_refund` on((`itboye_orders`.`order_code` = `itboye_order_refund`.`order_code`))) left join `itboye_orders_contactinfo` on((`itboye_orders`.`order_code` = `itboye_orders_contactinfo`.`order_code`))) left join `common_member` on((`itboye_orders`.`uid` = `common_member`.`uid`))) left join `itboye_store` on((`itboye_orders`.`storeid` = `itboye_store`.`id`))) ;

-- ----------------------------
-- View structure for v_user_info
-- ----------------------------
DROP VIEW IF EXISTS `v_user_info`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_user_info` AS select `um`.`email` AS `email`,`um`.`id` AS `id`,`um`.`status` AS `status`,
`um`.`reg_from` AS `reg_from`,`um`.`country_no` AS `country_no`,
`um`.`reg_time` AS `reg_time`,`um`.`reg_ip` AS `reg_ip`,
`um`.`last_login_time` AS `last_login_time`,`um`.`last_login_ip` AS `last_login_ip`,
`um`.`update_time` AS `update_time`,`um`.`username` AS `username`,
`um`.`mobile` AS `mobile`,`um`.`password` AS `password`,
`mc`.`alibaichuan_id` AS `alibaichuan_id`,`mc`.`idcode` AS `idcode`,
`mc`.`default_address` AS `default_address`,`mc`.`exp` AS `exp`,
`mc`.`invite_id` AS `invite_id`,`mc`.`wxopenid` AS `wxopenid`,
`mc`.`weixin` AS `weixin`,`mc`.`phone_validate` AS `phone_validate`,
`mc`.`email_validate` AS `email_validate`,`mc`.`identity_validate` AS `identity_validate`,
`mc`.`score` AS `score`,
`cm`.`head` AS `head`,`cm`.`login` AS `login`,
`cm`.`sign` AS `sign`,`cm`.`bg_img` AS `bg_img`,`cm`.`realname` AS `realname`,
`cm`.`idnumber` AS `idnumber`,`cm`.`nickname` AS `nickname`,`cm`.`sex` AS `sex`,
`cm`.`birthday` AS `birthday`,`cm`.`qq` AS `qq`,`cm`.`lng` AS `lng`,`cm`.`lat` AS `lat` 
from `common_member` `cm` 
left join `itboye_ucenter_member` `um` on(`um`.`id` = `cm`.`uid`)
left join `itboye_member_config` `mc` on(`mc`.`uid` = `cm`.`uid`) ;

-- ----------------------------
-- View structure for v_user_wallet_info
-- ----------------------------
DROP VIEW IF EXISTS `v_user_wallet_info`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_user_wallet_info` AS select `w`.`uid` AS `uid`,`w`.`wallet_type` AS `wallet_type`,if(((`w`.`account_balance` - `w`.`frozen_funds`) > 0),(`w`.`account_balance` - `w`.`frozen_funds`),0) AS `balance`,`w`.`frozen_funds` AS `frozen_funds`,`w`.`account_balance` AS `account_balance`,`um`.`mobile` AS `mobile`,`cm`.`nickname` AS `nickname` from ((`itboye_wallet` `w` join `itboye_ucenter_member` `um` on((`um`.`id` = `w`.`uid`))) join `common_member` `cm` on((`cm`.`uid` = `w`.`uid`))) where (`um`.`status` = 1) ;
