INSERT INTO `itboye_product` VALUES ('30', '99', '卡车配件 调压阀 YC79002', '', '卡车配件 调压阀 YC79002', '0', '', '', '', '', '5', '1485062826', '1486629713', '1', '1', '12', '', '0.00', '调压阀能根据空气压力大小，自动调节制动系统的工作压力，防止气流过载后而自动放气功能并有去除水油等功能。\r\n', '0', '001', '', '');
