INSERT INTO `itboye_product` VALUES ('32', '99', '解放卡车配件151手控阀 YC3009', '', '解放卡车配件151手控阀 YC3009', '0', '', '', '', '', '5', '1485062939', '1486629713', '1', '1', '12', '', '0.00', '手制动阀主要控制汽车后桥上的弹簧制动室而实施驻车制动，而且由于可输出一个准确而连续变化的气压，所以也可以通过改变弹簧室的气压实施辅助制动。\n\n技术参数：\n工作温度：-40℃+80℃\n工作压力：0.8Mpa\n进气口尺寸：NPT1/4\n出气口尺寸：NPT 1/4\n安装螺纹：2*M10-6H*70\n', '0', '001', '', '');
