INSERT INTO `itboye_product` VALUES ('34', '99', '汽车空气干燥筒 通用型干燥筒 YC2001', '', '汽车空气干燥筒 通用型干燥筒 YC2001', '0', '', '', '', '', '5', '1485063054', '1486629713', '1', '1', '12', '', '0.00', '空气干燥器能自动控制制动系统的工作压力，并且通过干燥筒内的干燥剂对压缩空气中的水分进行干燥。汽车制动气路中的积水，会引起金属元件锈蚀、橡胶密封件龟裂、润滑油脂分解失效、管路塞等故障，严重影响行车安全性。空气干燥器利用分子筛作干燥剂，采用与卸荷调压阀一体的整体式结构，巧妙利用调压阀卸荷排气的动作过程，使再生贮气筒中的干燥压缩空气反向通过干燥剂筒，将干燥剂表面吸附的水分带走排入大气，实现了分子筛的再生活化，能长期有效地吸收压缩空气中的水分。\n', '0', '001', '', '');
INSERT INTO `itboye_product` VALUES ('35', '99', '厂家直销供应解放卡车配件 挂车制动阀 YC73004', '', '厂家直销供应解放卡车配件 挂车制动阀 YC73004', '0', '', '', '', '', '5', '1485063113', '1486629713', '1', '1', '12', '', '0.00', '用于控制挂车或半挂车的制动，装于牵引车上适用于挂车是双管路制动系统，牵引车主制动是双回路系统，停车或是紧急制动是断气式制动。具有当挂车制动系统控制管路连接断裂或漏气会自动引起挂车制动的功能。\n\n技术参数：\n5*M18*1.5-6H\n端口：M16*1.5（41，42，43）\n出气口尺寸：M16*1.5\n安装尺寸：85*85\n安装螺纹：M8\n工作压力：0.8Mpa\n工作温度：-40℃+80℃ \n', '0', '001', '', '');
