INSERT INTO `itboye_product` VALUES ('106', '368', '畅力CNG/LPG双燃料发动机油CH-4/SJ 大桶18L', '', '畅力CNG/LPG双燃料发动机油CH-4/SJ 大桶18L', '0', '', '', '', '', '2', '1487645847', '1487646049', '1', '1', '12', '', '0.00', '包装规格：\r\n4L、18L、200L\r\n粘度（质量）等级：\r\n15W/40、20W/50\r\n性能特点：\r\nCNG/LPG双燃料发动机油\r\n采用进口VHVI优质基础油，结合UDD抗磨金刚石技术精制而成；\r\n可为各类新型燃气发动机、柴油及汽油发动机提供高效保护并延长发动机寿命；\r\n清洁溶解配方，去除顽固油泥和积碳，保持发动机内部清净。\r\n适用范围：\r\n适用于天然气、液化石油气发动机。', '0', '123', '', '');
