INSERT INTO `itboye_product` VALUES ('110', '392', '锐行非凡全合成汽油机油 SN  4L', '', '锐行非凡全合成汽油机油 SN  4L', '0', '', '', '', '', '2', '1490684826', '1490690354', '1', '1', '12', '', '0.00', '高性能全合成发动机油，具有杰出的低温流动性和高效的保护功能。\r\n推荐用于部分使用涡轮增压或直喷技术的先进汽油发动机上。尤其推荐使用低粘\r\n度润滑油的发动机上。\r\n四季通用，恶劣的工作条件下(高速公路、繁忙的城市道路等)均能正常使用。\r\n能在高温、高负荷、高速条件等容易导致润滑油失效的极端状况下保持超长的耐\r\n久性和稳定性。\r\n适用于高性能涡轮增压发动机、增压汽油发动机及某些柴油多气门燃料直喷发动机。\r\n高性能全合成发动机润滑油，全面提升发动机运转性能。\r\n出色的热稳定性和抗氧化性，延长换油周期。\r\n保持活塞、活塞环、环槽及阀系的清洁，保证发动机始终处于良好的工作状态。\r\n低温启动过程中，迅速参与循环提供保护，显著提高发动机的低温工作效率。\r\n优越的粘温性能，在任何苛刻的工作条件下，都可为发动机提供完美保护。\r\n增强对发动机部件，尤其是涡轮增压器的有效保护，延长发动机及其主要部件的使\r\n用寿命。\r\n保持燃油经济性，显著节省燃油消耗\r\n优异的磷保持能力，保护尾气后处理系统。', '0', '123', '', '');
INSERT INTO `itboye_product` VALUES ('111', '392', '锐行非凡合成型汽油机油 SN  4L', '', '锐行非凡合成型汽油机油 SN  4L', '0', '', '', '', '', '2', '1490685590', '1490690292', '1', '1', '12', '', '0.00', '全新合成技术多级粘度发动机润滑油，为满足现代车型用油需求特别研制。\r\n使用高品质合成基础油，配合高性能的添加剂调和而成，超越 API \r\nSN/ILSAC GF-5规范要求。\r\n适用于使用涡轮增压、多气门的先进汽油发动机上，同时也适用于使用涡轮增压\r\n或自然通风的柴油发动机。 \r\n满足各种严苛条件下的使用要求  (城市交通、一般公路、高速公路等  )，适合各种\r\n驾驶状态，四季通用。\r\n利用毫微级润滑粒子吸附在金属表面形成高强度保护膜并填平金属凸凹，改善摩擦表面 \r\n减少摩擦阻力，提供强有力保护。       \r\n优异的抗氧化性能和热稳定性，有效控制和降低油泥生成，提供更为长久的优质润\r\n滑保护。\r\n卓越的抗磨性能，有效减少磨损，延长发动机寿命。\r\n采用润滑油分子致密技术，提升油膜强度，显著降低活塞积碳。\r\n合成技术配方，满足低挥发要求，有效降低机油消耗，确保发动机清洁。\r\n增强对发动机部件，尤其是涡轮增压器的有效保护，延长发动机及其主要部件的使\r\n用寿命。\r\n优异的磷保持能力，保护尾气后处理系统。', '0', '123', '', '');
INSERT INTO `itboye_product` VALUES ('112', '392', '锐行非凡合成型汽油机油 SL  4L', '', '锐行非凡合成型汽油机油 SL  4L', '0', '', '', '', '', '2', '1490685777', '1490690262', '1', '1', '12', '', '0.00', '全新合成技术发动机机油\r\n适用于各种国产及进口车上使用，适合四季使用\r\n适用于现代高性能自然吸气式发动机\r\n可用于全天候下的所有工作条件(城市道路、普通公路和高速公路)\r\n适用于装有催化装置并使用无铅汽油的车辆\r\n多个粘度级别，适合不同工况要求\r\n锐行ＳＬ产品在低温下拥有出色的流动性，使其低温下容易启动\r\n并节省燃油\r\n高效清净技术\r\n高粘度指数\r\n使用中出色的粘度稳定性\r\n出色的清净性和分散性\r\n出色的抗磨损和抗腐蚀性能\r\n抗氧化、防锈、抗起泡性能极好', '0', '123', '', '');
INSERT INTO `itboye_product` VALUES ('113', '392', '锐行非凡合成型汽油机油 SJ(双燃料)  4L', '', '锐行非凡合成型汽油机油 SJ(双燃料)  4L', '0', '', '', '', '', '2', '1490685901', '1490690232', '1', '1', '12', '', '0.00', '多级粘度汽油发动机油\r\n适用于LNG/CNG发动机的使用\r\n可用于全天候下的所有工作条件(城市道路、普通公路和高速公路)\r\n适用于多气阀，最新电喷技术发动机\r\n适用于装有催化装置并使用无铅汽油的车辆\r\n高粘度指数，适合大范围的工作温度变化\r\n出色的抗氧化性能，延长机油使用寿命\r\n极佳的清净性和分散性，有效提高发动机性能和寿命\r\n出色的抗磨，抗腐蚀、防锈性能，全面保护发动机\r\n有效减少低温锈蚀，腐蚀及沉淀物形成', '0', '123', '', '');
INSERT INTO `itboye_product` VALUES ('114', '392', '赛象 轮胎SX-558', '', '免费配送安装', '0', '', '', '', '', '3', '1490755067', '1490755296', '0', '1', '12', '', '0.00', '花纹特点，高速、高载、超强的抗侧滑、湿滑性能，采用低滚动阻力配方和胎面设计，有效降低油耗，节能环保。散热性能好适合长距离高速运输，驾驶更舒适，行驶更安全。\r\n适用路况，国道、省道、高速公路等良好性铺装路面。', '0', '007', '', '');
INSERT INTO `itboye_product` VALUES ('115', '392', '赛象 轮胎SX-516', '', '免费配送安装', '0', '', '', '', '', '3', '1490755373', '1490755847', '0', '1', '12', '', '0.00', '花纹特点，高速、高载、超强的抗侧滑、湿滑性能，采用低滚动阻力配方和低生热胎面设计，有效降低油耗，节能环保。散热性能好适合长距离高速运输，驾驶更舒适，行驶更安全。\r\n适用路况，国道、省道、高速公路等良好性铺装路面。', '0', '007', '', '');
INSERT INTO `itboye_product` VALUES ('116', '392', '赛象 轮胎SX-509', '', '免费配送安装', '0', '', '', '', '', '3', '1490755830', '1490756031', '0', '1', '12', '', '0.00', '花纹特点，适用于良好路面的导向轮位，胎面磨耗性能优良，胎肩生热低，能适应长距离、高速度的使用条件。高性能的胎面配方，能抵抗胎面的不规则磨损，延长轮胎使用寿命。胎肩外边部沟槽设计可抵抗压力引起的胎肩裂口，改善边部波动磨损，降低生热。\r\n适用路况，国道、省道、高速公路等良好性铺装路面。', '0', '007', '', '');
INSERT INTO `itboye_product` VALUES ('117', '392', '赛象 轮胎SX-506+', '', '免费配送安装', '0', '', '', '', '', '3', '1490756157', '1490756274', '0', '1', '12', '', '0.00', '花纹特点，适用于良好路面的导向轮位，胎面磨耗性能优良，胎肩生热低，能适应长距离、高速度的使用条件。纵向的条状花纹和特殊的胎面细沟能提供良好的直线行驶性能和防偏摩性能。胎肩外边部沟槽设计可抵抗压力引起的胎肩裂口，改善边部波动磨损，降低生热。\r\n适用路况，国道、省道、高速公路等良好性铺装路面。', '0', '007', '', '');
